static QUOTE_23_54_0: Minute = Minute {title: "Conclave",author: "Greg Tobin",start: "His watch read ",time: "11.54pm",end: " Eastern Standard Time. Already it was nearly 6.00am in Rome. He had left a city frozen by a harsh January storm, after a bleak, wet Christmas season.",};
static QUOTE_23_55_0: Minute = Minute {title: "Harry Potter and the Prisoner of Azkaban",author: "J. K. Rowling",start: "“I am going to lock you in. It is-” he consulted his watch, “",time: "five minutes to midnight",end: ". Miss Granger, three turns should do it. Good luck.\"",};
static QUOTE_23_55_1: Minute = Minute {title: "The Moonstone",author: "Wilkie Collins",start: "I looked at my watch. It wanted ",time: "five minutes to twelve",end: ", when the premonitory symptoms of the working of the laudanum first showed themselves to me. At this time, no unpractised eyes would have detected any change in him. But, as the minutes of the new morning wore away, the swiftly-subtle progress of the influence began to show itself more plainly. The sublime intoxication of opium gleamed in his eyes; the dew of a stealthy perspiration began to glisten on his face. In five minutes more, the talk which he still kept up with me, failed in coherence.",};
static QUOTE_23_56_0: Minute = Minute {title: "Wicked Women",author: "Fay Weldon",start: "The human race is at the end of the line, the doomsday clock ticks on. It’s stopped for a decade at ",time: "four minutes to midnight",end: ", but there the hands still stand. Any minute now they’ll begin to move again.",};
static QUOTE_23_57_0: Minute = Minute {title: "No Country for Old Men",author: "Cormac McCarthy",start: "Wells looked out at the street. “What time is it?” he said. Chigurh raised his wrist and looked at his watch. “",time: "Eleven fifty-seven",end: "” he said. Wells nodded. By the old woman’s calendar I’ve got three more minutes.",};
static QUOTE_23_58_0: Minute = Minute {title: "A Short History of Nearly Everything",author: "Bill Bryson",start: "Humans emerge ",time: "one minute and seventeen seconds before midnight",end: ". The whole of our recorded history, on this scale, would be no more than a few seconds, a single human lifetime barely an instant.",};
static QUOTE_23_59_0: Minute = Minute {title: "The Man Who Walked Through Walls",author: "Marcel Aymé",start: "At ",time: "a minute to midnight",end: ", Roquenton was holding his wife’s hand and giving her some last words of advice. On the stroke of midnight, she felt her companion’s hand melt away inside her own.",};
static QUOTE_23_59_1: Minute = Minute {title: "No Country for Old Men",author: "Cormac McCarthy",start: "Chigurgh rose and picked up the empty casing off the rug and blew into it and put it in his pocket and looked at his watch. The ",time: "new day was still a minute away",end: ".",};

